import React, { Component } from 'react'
import './News.css'
import {Container,Row,Col,Image} from 'react-bootstrap'

export default class News extends Component {
    render() {
        return (
            <div>
                <Image src="assets/mountain-man.jpg" className="header-image"/>
                <Container>
                    <h2>News</h2>
                    <Row>
                    <Col xs={12} sm>
                    </Col>
                    </Row>
                </Container>
            </div>
        )
    }
}
